import { createSelector } from 'reselect';

export const getSelectedExperimentData = (state) => state.experimentData;

const groupDataBy = (data, option) => {
    debugger;
    const indexValue = data.indexOf(option);
    debugger;
};


export const getProcessedData = createSelector(
    [getSelectedExperimentData],
    (experimentData) => {
        if (experimentData.isExperimentDataLoading) { return; }

        experimentData.data.dataruns.map(datarun => {
            const timeSeries = groupDataBy(datarun.prediction, 'y_raw');
            debugger;
            return {
                timeSeries,
            };
        });
    },
);
